window.bookSummaryJSON = "<p><b>They're hers to keep, and she's theirs to cherish, but sometimes, that just isn't enough....</b></p> <p>Thanks to one small accident that changed everything,&nbsp;Sascha's life is on the brink of implosion. She has her men at her back, but when one of her lovers decides to go rogue, it could ultimately destroy their relationship.</p> <p>She's always has their hearts, but what about their heads? That they cherish her was never in doubt, but can Sascha's men can give her what she needs?</p> <p>With their world in flux, she'll need a lot more than cherishing....</p>"; 
